since 0.0.3 package-local 📖 read the guide for this feature! default = <none> in your dist-workspace.toml or dist.toml: [dist]
targets = [ "x86_64-pc-windows-msvc", "x86_64-unknown-linux-gnu", "x86_64-apple-darwin", "aarch64-apple-darwin",
] This is a list of target platforms you want your packages to be built for. The supported choices are: x64 macOS: "x86_64-apple-darwin" x64 Windows: "x86_64-pc-windows-msvc" x64 Linux: "x86_64-unknown-linux-gnu" arm64 macOS (Apple silicon): "aarch64-apple-darwin" arm64 Linux: "aarch64-unknown-linux-gnu" x64 Linux (static musl): "x86_64-unknown-linux-musl" arm64 Linux (static musl): "aarch64-unknown-linux-musl" By default all runs of cargo-dist will be trying to handle all platforms specified here at once. If you specify --target=... on the CLI this will focus the run to only those platforms. As discussed in concepts , this cannot be used to specify platforms that are not listed in metadata.dist, to ensure different runs agree on the maximum set of platforms.

