members = [ "cargo:rel/path/to/rust/workspace", "npm:some/js/project/", "npm:some/other/js/project/", "dist:a/generic/project/"
] In a dist-workspace.toml, this specifies the various projects/workspaces/packages that should be managed by cargo-dist. Each member is of the format <project-type>:<relative-path> where relative-path is a path relative to the dist-workspace.toml to a directory containing that type of project, and project-type can be one of: cargo: expect a Cargo.toml for a cargo-based Rust project in that dir npm: expect a package.json for an npm-based JavaScript project in that dir dist: expect a dist.toml for a dist-based generic project in that dir

