We will be using bun build --compile to generate standalone executables for an npm project. In the future this will be more builtin, but for now we're going to need to teach your npm package to install bun and build itself. To do this we're going to add bun as a dev-dependency of our application and add a "dist" npm script that runs bun build on itself. Here's what the changes look like in axolotlsay-bun . Adding Bun As A Dev Dependency To make it easy for anyone working on our package to get the Right version of bun and use it, we can install it as an npm dev-dependency like so: npm i bun --save-dev Your package.json should now have something like this: "devDependencies": { "bun": "^1.x.x" } Adding A dist Script We want it to be easy for anyone to run our bun build on any platform, so add a script called "dist" to our package.json : "scripts": { "predist": "npm install", "dist": "node dist.js" }, We run npm install in "predist" to ensure dev-dependencies like bun are installed for anyone who runs the "dist" script. The name "dist" here is important, as cargo-dist will be looking for it. However the file it runs can have any name/location. Here we're calling it "dist.js", and it contains the following: // you might need to change this path to your package.json
const { bin } = require("./package.json");
const execSync = require('child_process').execSync; // Compute the target we're building for
const bunTargets = { "x86_64-pc-windows-msvc": "bun-windows-x64", "aarch64-apple-darwin": "bun-darwin-arm64", "x86_64-apple-darwin": "bun-darwin-x64", "aarch64-unknown-linux-gnu": "bun-linux-arm64", "x86_64-unknown-linux-gnu": "bun-linux-x64"
}
const distTarget = process.env.CARGO_DIST_TARGET || process.env.DIST_TARGET;
if (!distTarget) { throw "DIST_TARGET isn't set, so we don't know what platform to build!"
}
const bunTarget = bunTargets[distTarget];
if (!bunTarget) { throw `To the the best of our knowledge, bun does not support building for ${distTarget}`;
}
const binExt = distTarget.includes("windows") ? ".exe" : ""; // setup bun
execSync("bun install"); // for each binary, run bun
for (binName of Object.keys(bin)) { const binScript = bin[binName]; const binPath = `${binName}${binExt}`; execSync(`bun build ${binScript} --compile --target ${bunTarget} --outfile ${binPath}`);
} Ideally you won't have to customize this script at all (except maybe the relative path to package.json on the first line), because it reads your package.json and determines what to do for you. In particular it requires you to have a "bin" field in your package.json : "bin": { "axolotlsay-bun": "index.js" }, While you're here, you should also make sure you've set required fields like: "name" "version" "repository" set So your package.json should at a minimum look something like this: { "name": "axolotlsay-bun", "version": "0.4.0", "repository": "github:axodotdev/axolotlsay-hybrid", "bin": { "axolotlsay-bun": "index.js" }, "scripts": { "predist": "npm install", "dist": "node dist.js" }, "devDependencies": { "bun": "^1.x.x" }
} Adding dist-workspace.toml cargo-dist uses a custom configuration format called dist-workspace.toml, written in the TOML format. cargo-dist can manage most of your settings for you, or find them in your package.json, but we need to tell it that we're making a JS project. Create a file named dist-workspace.toml in the root of your repository. These are the entire contents of the file (you supply the path): [workspace]
members = ["npm:relative/path/to/your/package/"] (If your project is in the root, this may just be members = ["npm:./"])
